Catch a Fire is the major label debut album for Jamaican roots reggae band The Wailers, released on Island Records in 1973 (see 1973 in music). The album established the band as international superstars, and Marley in particular became world-famous, especially in the Caribbean and Africa, and among immigrants in Europe and African-Americans in the United States. The socially aware lyrics and militant tone surprised many listeners, but others were attracted to songwriters Bob Marley and Peter Tosh's confrontational subjects and optimistic view of a future free from oppression.
